import "./center.css";

function Center() {
  return (
    <div className="row justify-content-center" id="whole_center">
        <div className="col-sm-12 col-md-6 col-lg-6">
            <div className="row justify-content-center" id="pic">
                <img src="./pran.PNG" alt="PRAN" id="pran_img"></img>
            </div>
            <div className="row justify-content-center" id="name">
                
            </div>
            <div className="row justify-content-center" id="menu">

            </div>
        </div>
    </div>
  );
}

export default Center;
